import React, { Component } from 'react';
import { Route, Switch } from 'react-router-dom';
import { Welcome, About } from '../pages';

class App extends Component {
  render() {
    return(
      <div>
        <Route exact path="/" component={Welcome} />
        <Route path="/about" component={About} />
        
      </div>
    );
  }
}

export default App
